import React from 'react';
import {useSelector} from "react-redux";

const History = () => {
    const history = useSelector(state=>state.app.history);
    console.log(history);
    return (
        <div>
            <table>
            {
                history.map((item,index)=>{
                    return (
                        <tr>
                            <td>{index}</td>
                            <td>{item.kind}</td>
                            <td>{item.rightAnswers}</td>
                            <td>{item.totalAnswers}</td>
                        </tr>
                    )
                })
            }
            </table>
        </div>
    );
};

export default History;
